import{_ as a,c as t,o as s,ag as o}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"CREATE ACCESS METHOD","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/CREATE_ACCESS_METHOD.md","filePath":"docs/7x/ref_guide/sql_commands/CREATE_ACCESS_METHOD.md"}'),i={name:"docs/7x/ref_guide/sql_commands/CREATE_ACCESS_METHOD.md"};function n(d,e,c,r,l,h){return s(),t("div",null,e[0]||(e[0]=[o(`<h1 id="create-access-method" tabindex="-1">CREATE ACCESS METHOD <a class="header-anchor" href="#create-access-method" aria-label="Permalink to &quot;CREATE ACCESS METHOD&quot;">​</a></h1><p>Defines a new access method.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>CREATE ACCESS METHOD &lt;name&gt;</span></span>
<span class="line"><span>    TYPE &lt;access_method_type&gt;</span></span>
<span class="line"><span>    HANDLER &lt;handler_function&gt;</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>CREATE ACCESS METHOD</code> creates a new access method.</p><p>The access method name must be unique within the database.</p><p>Only superusers can define new access methods.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>name : The name of the access method to create.</p><p>access_method_type : The type of access method to define. Only <code>TABLE</code> and <code>INDEX</code> types are supported at present.</p><p>handler_function : handler_function is the name (possibly schema-qualified) of a previously registered function that represents the access method. The handler function must be declared to take a single argument of type <code>internal</code>, and its return type depends on the type of access method; for <code>TABLE</code> access methods, it must be <code>table_am_handler</code> and for <code>INDEX</code> access methods, it must be <code>index_am_handler</code>. The C-level API that the handler function must implement varies depending on the type of access method. The table access method API is described in <a href="https://www.postgresql.org/docs/12/tableam.html" target="_blank" rel="noreferrer">Table Access Method Interface Definition</a> in the PostgreSQL documentation. The index access method API is described in <a href="https://www.postgresql.org/docs/12/indexam.html" target="_blank" rel="noreferrer">Index Access Method Interface Definition</a>.</p><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Create an index access method <code>heptree</code> with handler function <code>heptree_handler</code>:</p><div class="language-sql vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sql</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">CREATE</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> ACCESS METHOD heptree </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">TYPE</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> INDEX</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> HANDLER heptree_handler;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p><code>CREATE ACCESS METHOD</code> is a WarehousePG extension.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./DROP_ACCESS_METHOD.html">DROP ACCESS METHOD</a>, <a href="./CREATE_OPERATOR_CLASS.html">CREATE OPERATOR CLASS</a>, <a href="./CREATE_OPERATOR_FAMILY.html">CREATE OPERATOR FAMILY</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,20)]))}const E=a(i,[["render",n]]);export{m as __pageData,E as default};
